import classes from './Container.module.css';
import Buttons from './Buttons/Buttons';
import React from 'eact';
import { BrowserRouter, Switch, Route, NavLink } from 'eact-router-dom';
import Archive from '../ArchiveSection';
import News from '../NewsSection';
import Documents from '../Documents';


const routes = [
{ path: '/', exact: true, component: Buttons },
{ path: '/archive', component: Archive },
{ path: '/news', component: News },
{ path: '/documents', component: Documents },
];

const App = () => {
return (
<BrowserRouter>
<div className={classes.App}>
<header className={classes.Header}>
<h1>Контакты</h1>
</header>
<main className={classes.Main}>
<Switch>
<Route exact path="/" component={Buttons} />
{routes.map((route) => (
<Route key={route.path} path={route.path} component={route.component} />
))}
</Switch>
<nav>
<NavLink exact to="/" activeClassName="active">Архив заданий регионального этапа ВсОШ по физике</NavLink>
<NavLink to="/news" activeClassName="active">Новости</NavLink>
<NavLink to="/documents" activeClassName="active">Документы</NavLink>
</nav>
</main>
<footer className={classes.Footer}>
<p>Контакты</p>
</footer>
</div>
</BrowserRouter>
);
};

export default App;
